import React, { Component } from "react";
import { Grid } from "@material-ui/core";

class Men extends Component {
  render() {
    return (
      <div style={{ minHeight: 550 }}>
        <Grid container direction="row"  xm={6}>
          <Grid item xs={2}>
            <div style={{ width: 100, backgroundColor: "red" }}>1</div>
          </Grid>
          <Grid item xs={6} xm={6}>
            <div style={{ width: 100, backgroundColor: "blue" }}>2</div>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default Men;
